webpackJsonp([0xac512b5b7d3e],{6122:function(e,t){e.exports={data:{post:{html:'<p>As noted by <a title="Noch\'n Blogg." href="http://lumma.de/mt/archives/000270.html#000270">Nico</a>, police have just announced that the <a href="http://www.spiegel.de/politik/deutschland/0,1518,251641,00.html">ex FDP vice-chair Jürgen W. Möllemann was killed</a> while parachuting. Suicide is strongly suspected, as today police carried out <a href="http://de.news.yahoo.com/030605/3/3h92v.html">several search warrants</a> related to investigations of Möllemann\'s finances and the <a href="http://de.news.yahoo.com/030605/3/3h8zb.html">Bundestag revoked his parlimentary immunity</a>. </p>\n<p>See Stefan Sharkansky\'s <a title="The Jürgen W. Möllemann File" href="http://www.moellemann.com/">Jürgen W. Möllemann File</a> for background on the controversial German politician.</p>\n<p>DW World: <a title="Germany" href="http://www.dw-world.de/english/0,3367,1432_A_886508_1_A,00.html">Controversial Politician Dies in Parachuting Accident</a></p>',fields:{title:"",date:"05 Jun 2003",url:"https://papascott.de/2003-06-05-moellemann-killed-while-parachuting/"}}},pathContext:{slug:"/2003-06-05-moellemann-killed-while-parachuting/",prev:{fields:{title:"",date:"05 Jun 2003",slug:"/2003-06-05-ich-hab-noch-so-einen-alten-gruenen-oesi-reisepass/"}},next:{fields:{title:"Needles in Haystacks",date:"05 Jun 2003",slug:"/2003-06-05-needles-in-haystacks/"}}}}}});
